import React, { useState, useEffect } from 'react'
import axios from 'axios'
import Slider from 'react-slick'
import FsLightbox from 'fslightbox-react'
import * as Icon from 'react-feather'
import Sectiontitle from '../components/Sectiontitle'
import Layout from '../components/Layout'
import Service from '../components/Service'
import Testimonial from '../components/Testimonial'

function About() {
  const [toggler, setToggler] = useState(false)
  const [information, setInformation] = useState('')
  const [services, setServices] = useState([])
  const [reviews, setReviews] = useState([])

  const sliderSettings = {
    dots: false,
    infinite: true,
    arrows: false,
    speed: 500,
    slidesToShow: 2,
    slidesToScroll: 2,
    autoplay: true,
    autoplaySpeed: 6000,
    pauseOnHover: true,
    adaptiveHeight: true,
    responsive: [
      {
        breakpoint: 768,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
        },
      },
    ],
  }

  const handleToggler = (event) => {
    setToggler({
      toggler: event,
    })
  }

  // useEffect(() =>{
  //   axios.get('/api/information')
  //     .then(response =>{
  //       setInformation(response.data)
  //     })
  //   axios.get('/api/services')
  //     .then(response =>{
  //       setServices(response.data)
  //     })
  //   axios.get('/api/reviews')
  //     .then(response =>{
  //       setReviews(response.data)
  //     })
  // }, [])

  return (
    <Layout>
      <div className="mi-about-area mi-section mi-padding-top">
        <div className="container">
          <Sectiontitle title="About Me" />
          <div className="row">
            <div className="col-lg-6">
              <div className="mi-about-image">
                <img
                  src="/images/myImage.jpg"
                  // src={information.aboutImage}
                  alt="about"
                  onClick={() => handleToggler(!toggler)}
                />
                <span className="mi-about-image-icon">
                  <Icon.ZoomIn />
                </span>
                {/* <FsLightbox
                  toggler={toggler}
                  sources={[information.aboutImageLg]}
                /> */}
              </div>
            </div>
            <div className="col-lg-6">
              <div className="mi-about-content">
                <h3>
                  I am <span className="color-theme">Himesh Singh Chauhan</span>
                  {/* I am <span className="color-theme">{information.name}</span> */}
                </h3>
                <p>
                  I am a third year student at the Gyan Ganga Institute of
                  Technology. My primary passions are computer science and
                  Chess.
                </p>
                <ul>
                  <li>
                    <b>Full Name</b> Himesh Singh Chauhan
                  </li>
                  <li>
                    <b>Age</b> 19
                  </li>
                  <li>
                    <b>Phone</b> 9424659924
                  </li>
                  <li>
                    <b>Nationality</b> Indian
                  </li>
                  <li>
                    <b>Languages</b>C++, Python, JavaScript
                  </li>
                  <li>
                    <b>Email</b> himesh.singh.csds21@ggits.net
                  </li>
                  <li>
                    <b>Address</b> Unknown
                  </li>
                  <li>
                    <b>Status</b> <u style={{'text-decoration':'none'}}>Junior Year Student</u>
                  </li>
                </ul>
                {/* <a href={information.cvfile} className="mi-button">Download Resume</a> */}
              </div>
            </div>
          </div>
        </div>
      </div>
      <div className="mi-service-area mi-section mi-padding-top">
        <div className="container">
          <Sectiontitle title="Interests" />
          <div className="mi-service-wrapper">
            <div className="row mt-30-reverse">
              {/* {services.map(service => (
                <div className="col-lg-4 col-md-6 col-12 mt-30" key={service.title}>
                  <Service content={service}/>
                </div>
              ))} */}
            </div>
          </div>
        </div>
      </div>

    </Layout>
  )
}

export default About

